import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import  Navbar  from '../Header/Navbar';
import  Search  from '../Content/Search';
import  Breadcrumbs  from '../Content/Breadcrumbs';
import Banner from '../Content/Banner'
import Listings from '../Content/Listings';
import Filter from '../Content/Filter';
function App() {
  return (
    <div className="App">
      <Navbar/>
      <Banner/>
      <section className="text-start text-muted m-2">
          <Breadcrumbs />
      </section>
      <section className="my-2 shadow">
          <Search />
      </section>
      <section className="w-100 my-2 bg-primary">
        <div className="container" style={{ maxWidth: 1260 + 'px' }}>  
           <div className="row border" style={{ maxWidth: 1260 + 'px' }}>  
              <Filter/>
              <Listings />           
          </div>
       
              <Filter/>
              <Listings />           
          </div>
      </section>
    </div>
  );
}

export default App;
